/* ==UserStyle==
@name           Deutschland Flagge für Youtube Video zeit Anzeige
@namespace      github.com/openstyles/stylus
@version        1.0.0
@description    Ersetzt den Roten Balken bei Youtube Videos mit ein Balken im Deutschland Flaggen style
@author         Me
==/UserStyle== */

@-moz-document domain("youtube.com") {
.html5-play-progress, .ytp-play-progress {
   background: url("data:image/png;base64,") repeat-x !important; 
background: linear-gradient(to bottom, #000 0%, #000 16.5%, #fe0 16.5%, #000 33%, #f00 33%, #f00 50%, #f00 50%, #f00 66%, #f00 66%, #f00 83.5%, #fe0 83.5%, #fe0 100%) !important;
background: -webkit-linear-gradient(top, #000 0%, #000 16.5%, #000 16.5%, #000 33%, #f00 33%, #f00 50%, #f00 50%, #f00 66%, #fe0 66%, #ffe100 83.5%, #ffea00 83.5%, #fe0 100%) !important;
background: -moz-linear-gradient(top, #000 0%, #000 16.5%, #000 16.5%, #000 33%, #000 33%, #f00 50%, #ffe600 50%, #000 66%, #fff700 66%, #ffe100 83.5%, #ef0 83.5%, #fff700 100%) !important;

}
.ytp-progress-bar-container:hover .ytp-scrubber-button,
.ytp-progress-bar-container:hover .ytp-load-progress{
	image-rendering: pixelated;
}
.html5-progress-bar-container, .ytp-progress-bar-container {
   height: 12px !important;
}
.html5-progress-bar, .ytp-progress-bar {
   margin-top: 12px !important;
}
.html5-progress-list, .ytp-progress-list, .video-ads .html5-progress-list.html5-ad-progress-list, .video-ads .ytp-progress-list.ytp-ad-progress-list {
   height: 12px !important;
}
.ytp-volume-slider-track {
   background: #0C4177 !important;
}
}
